import React from 'react';
import { Menu, Button } from 'antd';
import {
  AppstoreOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;



 const PageNav = () => {
    return (
      <>

      <Menu
          defaultOpenKeys={['sub1']}
          mode="inline"
          theme="dark"
          style={{ width: 256 }}
        >
          <Menu.Item key="1" icon={<PieChartOutlined />}>
            Option 1
          </Menu.Item>






        </Menu>












      </>
    )

    }
export default PageNav
